```sparql
SELECT ?predecessor WHERE {
  # Find the child of Saw Min Phyu who is royalty
  ?childOfSawMinPhyu dbo:spouse <http://dbpedia.org/resource/Saw_Min_Phyu> ;
                     dbo:child ?royalChild .
  FILTER(?royalChild IN (<http://dbpedia.org/resource/Prince_Siamese>, <http://dbpedia.org/resource/Princess_Mahamakut>)).

  # Find the predecessor of the royal child
  ?royalChild dbo:predecessor ?predecessor .
}
UNION
{
  # Find the parent of the child of Minye Kyawswa
  ?parentOfMinyeKyawswa dbo:child <http://dbpedia.org/resource/Minye_Kyawswa> ;
                          dbo:parent ?grandParent .

  # Find the predecessor of the grandparent
  ?grandParent dbo:predecessor ?predecessor .
}
```

